const About = () => {
    return (
        <div className="container">
            <p>Hey, I'm AK. </p>
            <p>I consider myself to be internet native. I began connecting to bulletin boards and IRC chats from a 4.4kbps modem from the school library in the early 90's</p>
            <p>I'm continuously inspired to explore life. To learn. To grow. & to iterate toward the best version of my self.</p>
            <p></p>
        </div>
    )
}

export default About
